```html
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Terminal Replica</title>
    <script src="https://cdn.tailwindcss.com"></script>
    <style>
        @import url('https://fonts.googleapis.com/css2?family=Source+Code+Pro:wght@400;600&display=swap');
        body {
            font-family: 'Source Code Pro', monospace;
        }
        .terminal {
            background-color: #000;
            color: #fff;
            padding: 1rem;
            border-radius: 0.25rem;
        }
        .command-line {
            color: #00ff00;
        }
    </style>
</head>
<body class="bg-black text-white p-4 font-mono">
    <div class="terminal">
        <div class="text-green-400">anti ~ % ls</div>
        <div class="text-yellow-300">B... B... 🍵 .DS_Store 🗑 .git git.gitignore 📝 .vscode 📂antiq-scraper 📂client2til 📂dev</div>
        <div class="text-green-400">anti ~ %</div>
    </div>
</body>
</html>
```

This code uses Tailwind CSS for styling and a monospaced font similar to what's typically used in terminal applications. The colors are set to match the appearance of the terminal in the image, with green text for commands and yellow for directory listings. The background is black, and the text is white to mimic the terminal's color scheme.
